Application::ScoringTypeEnum Application::toScoringTypeEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("GAME_LEVEL")) {
        return ScoringTypeEnum::GAME_LEVEL;
    }
    
    if (value == utility::conversions::to_string_t("GAME_OBJECT")) {
        return ScoringTypeEnum::GAME_OBJECT;
    }
    
    throw std::invalid_argument("Invalid value for conversion to ScoringTypeEnum");
}


const utility::string_t Application::fromScoringTypeEnum(const ScoringTypeEnum value) const
{
    switch(value)
    {
        
        case ScoringTypeEnum::GAME_LEVEL: return utility::conversions::to_string_t("GAME_LEVEL");
        
        case ScoringTypeEnum::GAME_OBJECT: return utility::conversions::to_string_t("GAME_OBJECT");
        
    }
}


